'''Lily Jane Collins''' ([[18 March]], [[1989]]) is an English-American actress, who played [[Edith Bratt]] in ''[[Tolkien (film)|Tolkien]]'' (2019).
She had previously auditioned for the role of [[Tauriel]] in [[The Hobbit (film series)|The Hobbit]] film series.<ref>[http://www.theqandapodcast.com/2019/05/tolkien-q-george-rr-martin-dome.html Q&A with the director and cast of ''Tolkien''] moderated by [[George R.R. Martin]] (accessed 5 July 2023)</ref>

